import React from "react";
import { FiArrowRight } from "react-icons/fi";
import { Link } from "react-router-dom";
import Layout from "../../common/Layout";
import Typed from "react-typed";

const ComingSoon = ({ column, teamStyle }) => {
  return (
    <Layout>
      <div className="container ptb--150">
        <div className="row">
          <div className="col-lg-12">
            <div className="inner text-center">
              <span className="subtitle">DIGITAL CONSULTING AGENCY</span>
              <h1 className="title theme-gradient display-two">
                Unique Business <br />{" "}
                <Typed
                  strings={["Consulting.", "Finance.", "Agency."]}
                  typeSpeed={80}
                  backSpeed={5}
                  backDelay={1000}
                  loop
                />
              </h1>
              <p className="description">
                We help our clients succeed by creating brand identities,
                digital experiences, and print materials.
              </p>
              <div className="button-group">
                <a
                  className="btn-default btn-medium round btn-icon"
                  target="_blank"
                  href="https://themeforest.net/checkout/from_item/33571911?license=regular"
                >
                  Purchase Now{" "}
                  <i className="icon">
                    <FiArrowRight />
                  </i>
                </a>
                <Link
                  className="btn-default btn-medium btn-border round btn-icon"
                  to="#"
                >
                  Contact Us{" "}
                  <i className="icon">
                    <FiArrowRight />
                  </i>
                </Link>
              </div>
            </div>
          </div>
        </div>
      </div>
    </Layout>
  );
};
export default ComingSoon;
